import React from "react";
import "./NewDetail.css";
import { useParams } from "react-router-dom";
import { useEffect } from "react";

const NewDetails = () => {
  const { id } = useParams();

  const getWine = () => {
    fetch("http://localhost:4000/getWine/" + id)
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
        
      });
  };
  useEffect(() => {
    getWine();
  }, []);

  return <div>{id}</div>;
};

export default NewDetails;
